import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
        <header>
          <nav>
              <ul>
                  <li>Home</li>
                  <li>About Us </li>
              </ul>
          </nav>
        </header>
    </div>
  );
}

export default App;
